export function generateIconUtilities(config) {
  const classes = [];

  // Base icon class
  classes.push({
    name: 'icon',
    css: `.icon {
  display: inline-block;
  width: 1.25rem;
  height: 1.25rem;
  vertical-align: middle;
  flex-shrink: 0;
  background-color: currentColor;
  -webkit-mask-repeat: no-repeat;
  mask-repeat: no-repeat;
  -webkit-mask-position: center;
  mask-position: center;
  -webkit-mask-size: contain;
  mask-size: contain;
}`
  });

  // Size modifiers
  const sizes = {
    'xs': '0.875rem',
    'sm': '1rem',
    'md': '1.5rem',
    'lg': '2rem',
    'xl': '2.5rem',
    '2xl': '3rem',
    '3xl': '4rem'
  };

  Object.entries(sizes).forEach(([name, value]) => {
    classes.push({
      name: `icon-${name}`,
      css: `.icon-${name} { width: ${value}; height: ${value}; }`
    });
  });

  // Color utilities
  classes.push({ name: 'icon-white', css: '.icon-white { background-color: white; }' });
  classes.push({ name: 'icon-black', css: '.icon-black { background-color: black; }' });
  classes.push({ name: 'icon-current', css: '.icon-current { background-color: currentColor; }' });

  // Semantic colors
  const semanticColors = ['primary', 'secondary', 'success', 'warning', 'error', 'info', 'neutral'];
  semanticColors.forEach(color => {
    classes.push({
      name: `icon-${color}`,
      css: `.icon-${color} { background-color: var(--color-${color}-600); }`
    });
    classes.push({
      name: `icon-${color}-light`,
      css: `.icon-${color}-light { background-color: var(--color-${color}-400); }`
    });
    classes.push({
      name: `icon-${color}-dark`,
      css: `.icon-${color}-dark { background-color: var(--color-${color}-800); }`
    });
  });

  // Individual icon classes
  Object.entries(iconData).forEach(([name, svgUrl]) => {
    classes.push({
      name: `icon-${name}`,
      css: `.icon-${name} {
  -webkit-mask-image: url("${svgUrl}");
  mask-image: url("${svgUrl}");
}`
    });
  });

  return {
    css: classes.map(c => c.css).join('\n'),
    classes
  };
}

